import * as React from "react";
import { useEffect, useState } from "react";

const DJANGO_HOST = process.env.DJANGO_HOST || "http://localhost:8000";

type Dog = {
  model: string
  pk: number;
  fields: {
    name: string;
    age:  number;
    my_email: string;
  };
};

const Dogs = () => {
  const [dogs, setDogs] = useState<Dog[]>([]);

  useEffect(() => {
    fetch(`${DJANGO_HOST}/dogs/`)
      .then((res) => res.json())
      .then((data) => {
        setDogs(data);
      });
  }, [])

  return (
    <>
      <h2>Dogs</h2>
      <ul>
        {dogs.map((dog) => (
          <li key={dog.pk}>{dog.fields.name}</li>
        ))}
      </ul>
    </>
  );
};

export default Dogs;
